import React, {useState} from 'react';
import './App.css';
// import generateData from '../src/components/ImageAnimation/images/images';
// import Slider from '../src/components/ImageAnimation/mainImages';
import {Main} from 'components/ImageAnimation/images/main';
import {Slider} from './components/ImageAnimation/images/Slider';

function App() {
  const [slide, setSlide] = useState(0);

  // eslint-disable-next-line @typescript-eslint/ban-ts-ignore
  // @ts-ignore
  function checkKey(e) {
    if (e.keyCode === 38) {
      setSlide(slide - 1);
    } else if (e.keyCode === 40) {
      setSlide(slide + 1);
    }
  }
  if (slide < 0) {
    setSlide(0);
  }
  return (
    <div role="button" tabIndex={0} className="App" onKeyDown={(e) => checkKey(e)}>
      <Main />
      <div
        className="slide7"
        style={
          slide === 5
            ? {transform: 'translateY(0%)', zIndex: 1000}
            : {transform: 'translateY(-110%)'}
        }
      >
        <Slider />
        <h1 className="slide7-h1">Projects</h1>
      </div>
    </div>
  );
}

export default App;
